INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5690, 30066, 'Abiraterone', 'Food may significantly increase the oral bioavailability of abiraterone acetate.  Compared to administration in the fasted state, abiraterone peak plasma concentration (Cmax) and systemic exposure (AUC) were approximately 7- and 5-fold higher, respectively, when a single dose of abiraterone acetate was administered with a low-fat meal (7% fat; 300 calories) and approximately 17- and 10-fold higher, respectively, when it was administered with a high-fat meal (57% fat; 825 calories).  Given the normal variation in the content and composition of meals, taking abiraterone acetate with meals has the potential to result in increased and highly variable exposures.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c6d8ed10dc330080557791364872ed01d884de4aa312f325855b60ffeef1f3a4e1caffd332474d014523472469f1ed815215f35d02006ed57dcf06097d236e04d1c648537ceb32ebbd07c76adc9072470aae499f811a90c4f251719b18a155b1072641ad112fff9a3d2757b00762f3a6d', NULL, X'');
