INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5766, 21197, 'Hydromorphone', 'Alcohol may potentiate the central nervous system (CNS) depressant effects of opioid analgesics including hydromorphone.  Concomitant use may result in additive CNS depression and impairment of judgment, thinking, and psychomotor skills.  In more severe cases, hypotension, respiratory depression, profound sedation, coma, or even death may occur.', 'alcohol', 'Major', '', 'DDInter', 0, X'', NULL, X'');
