INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5817, 30261, 'Acalabrutinib', 'Grapefruit juice may increase the plasma concentrations of acalabrutinib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  Inhibition of hepatic CYP450 3A4 may also contribute.  The interaction has not been studied with grapefruit juice, but has been reported for other CYP450 3A4 inhibitors.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'789c4d8ec10dc3300c0357e104d9a11b7405d9925315b114c8728b6e5fa3fde4451c1f47de2a1d5462a69a1674faa00888fbc29112c2786b3ee0f14b9f89e6ce1b70a754b11c18ab3d18f4726554b731fb99ea066fd8834e69313541c6577c4ead029ea1b6234328fbb2fdc7e8fa69fb025acd3d2b', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5818, 20724, 'Ibrutinib', 'Coadministration with grapefruit, grapefruit juice, or Seville oranges may significantly increase the plasma concentrations of ibrutinib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5819, 20725, 'Ibrutinib', 'Coadministration with grapefruit, grapefruit juice, or Seville oranges may significantly increase the plasma concentrations of ibrutinib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5820, 10785, 'Hyoscyamine', 'Use of anticholinergic agents with alcohol may result in sufficient impairment of attention so as to render driving and operating machinery more hazardous.  In addition, the potential for abuse may be increased with the combination.  The mechanism of interaction is not established but may involve additive depressant effects on the central nervous system.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c358ddb11c2300c045bb90ad2031dd082b09558836283252793ee51207c6846afdbbd696aa529acb4a1190b57eea47ae0c1a0ad49e68c3cbad4055ee2f43ab08b175075491194f85f248122e93601777239db3f3138a98d6aac41f2f6838292cb26f169e8fc1ef215ac9123052977af6c8611123dbd079eb5ed285131195f3ad03c73f273b74e1f290b4be3', NULL, X'');
